import React from "react";
import { navLinks } from "../../constants";

const Hamburger = ({ closeHam }) => {
  return (
    <div className="px-6 py-2">
      <div className="text-end">
        <button className="navitem w-[48px] text-2xl" onClick={closeHam}>
          <i className="fa-light fa-xmark" />
        </button>
      </div>
      <ul className="flex flex-col gap-4 mt-4">
        {navLinks.map((item, index) => {
          return (
            <li className="navitem py-3 flex-seperate" key={index}>
              <span>{item.label}</span>
              <i className="fa fa-chevron-right" />
            </li>
          );
        })}
        <li className="navitem py-3">
          <span>Support</span>
        </li>
        <li className="navitem py-3 flex-seperate">
          <div className="flex">
            <i className="fal fa-globe text-xl" />
            <div>
              <span>United States</span>
              <br />
              <span className="text-slate-300 font-thin text-xs mt-2">
                English
              </span>
            </div>
          </div>
          <i className="fa fa-chevron-right" />
        </li>
      </ul>
    </div>
  );
};

export default Hamburger;
